import React from 'react';
import {
    Name,
    NavBarContainer,
    NavigationContainer
} from './navBar.styled'

const NavBar = () => {
    return (
        <NavBarContainer>
            <Name>Jacob Rast</Name>
            <NavigationContainer>
                <NavigationButton>Portfolio</NavigationButton>
                <NavigationButton>Contact</NavigationButton>
                <NavigationButton></NavigationButton>
            </NavigationContainer>
        </NavBarContainer>
    )
}

export default NavBar;
